import Button from 'react-bootstrap/Button';

function App() {
  return (
    <div className="App">
      <Navbar></Navbar>
      <div className="content">
        <h1>Coffee Lovers</h1>
      </div>
      <button></button>
    </div>
  );
}

export default App;
